import { Component } from "react";
import "./Navbar.css";
import { Link } from "react-router-dom";

class Navbar extends Component {
  render() {
    return (
      <nav className="NavbarItems">
        <h1 className="navbar-logo">mes.</h1>
        <ul>
          <li>
            <Link>home</Link>
          </li>
        </ul>
      </nav>
    );
  }
}

export default Navbar;
